  return await axios({
    method: "get",
    url: "http://localhost:3001/get-candidate",
    responseType: "json",
  }).then((response) => {
    return response.data.data;
  });
};

// get all category details
export const GetCategory = async () => {
  return await axios({
    method: "get",
    url: "http://localhost:3001/get-category",
    responseType: "json",
  }).then((response) => {
    // console.log(response.data.data);
    return response.data.data;
  });
};

